import React from "react";

export async function GetLengths() {

    try {
        const response = await fetch('api/v1/bolt-configuration/length');
        return await response.json();
    } catch(error) {
        return "values could not be returned"
    }
}

export async function GetDiameters() {

    try {
        const response = await fetch('api/v1/bolt-configuration/diameter');
        return await response.json();
    } catch(error) {
        return "values could not be returned"
    }
}
